window.bookSummaryJSON = "<p>From number one <i>New York Times</i> and <i>USA Today</i> best-selling author Jennifer L. Armentrout comes the next installment in her Wicked series. </p> <p>As Caden and Brighton's attraction grows despite the odds stacked against a happily ever after, they must work together to stop an Ancient fae from releasing the Queen, who wants nothing more than to see Caden become the evil Prince once feared by fae and mortals alike. </p> <p><i>Every 1001 Dark Nights</i> novella is a standalone story. For new listeners, it’s an introduction to an author’s world. And for fans, it’s a bonus book in the author’s series. We hope you'll enjoy each one as much as we do.</p>"; 
